def transform(sequence):
    transformed_sequence = ''

    for i in range(len(sequence)):
        if sequence[i] != '0':
            transformed_sequence += sequence[i]
        else:
            left_nonzero_index = i
            for j in range(i+1, len(sequence)):
                if sequence[j] != '0':
                    right_nonzero_index = j
                    break
            num_nonzero = int(sequence[right_nonzero_index])
            transformed_sequence += str(num_nonzero)*(right_nonzero_index - left_nonzero_index + 1)

    return transformed_sequence
